import React from "react";

let Footer = function(){
    return(
        <form>
            <input class="form-control" type="number" placeholder="ID" aria-label="Disabled input example" />
            <input class="form-control" type="text" placeholder="Name" aria-label="Disabled input example" />
            <input class="form-control" type="number" placeholder="Age" aria-label="Disabled input example" />
            <input class="form-control" type="number" placeholder="Salary" aria-label="Disabled input example" />
        </form>
    );
}

export default Footer;
